<!doctype html>
<html lang="ko">
<head>
<meta charset="utf-8"/>
<meta name="viewport" content="width=device-width, initial-scale=1"/>
<title>경영혁신과 ERP 문제 풀기</title>
<style>
:root{ --bg:#ffffff; --ink:#111827; --muted:#6b7280; --line:#e5e7eb; --card:#ffffff;
       --accent:#2563eb; --ok:#16a34a; --bad:#dc2626; --head:#0f172a; }
*{box-sizing:border-box}
body{margin:0; font-family:system-ui,-apple-system,Segoe UI,Roboto,Pretendard,Noto Sans KR,Arial,sans-serif;
      background:var(--bg); color:var(--ink);}
.wrap{max-width:980px; margin:36px auto; padding:0 18px}
.header{display:flex; align-items:center; justify-content:space-between; gap:16px; margin-bottom:16px;
         border-bottom:2px solid var(--line); padding-bottom:12px;}
.header-left{display:flex; align-items:center; gap:12px}
.header .logo{height:72px; width:72px; object-fit:contain}
.header .brand{font-size:24px; font-weight:800; color:var(--head)}

h1{margin:18px 0 8px; font-size:22px}
.sub{color:var(--muted); margin-bottom:16px}

.panel{background:var(--card); border:1px solid var(--line); border-radius:14px; padding:14px}
.toolbar{display:flex; gap:10px; flex-wrap:wrap; align-items:center}
.btn{background:linear-gradient(180deg,#3b82f6,#2563eb); border:none; color:#fff; padding:10px 14px; border-radius:12px; cursor:pointer; font-weight:700}
.btn.secondary{background:#111827; color:#fff; opacity:.9}
.btn.ok{background:#065f46} .btn:disabled{opacity:.55; cursor:not-allowed}

.qcard{background:var(--card); border:2px solid var(--line); border-radius:14px; padding:14px; margin:20px 0}
.qhead{display:flex; gap:10px; align-items:center; justify-content:space-between}
.qnum{font-weight:800; color:var(--muted)}
.flag{font-weight:900; font-size:18px}
.flag.ok{color:var(--ok)} .flag.bad{color:var(--bad)}
.qtext{margin-top:6px; line-height:1.6; font-size:16px}

.opts{margin-top:12px; display:grid; gap:10px}
.opt{display:flex; gap:12px; padding:12px; border:1px solid var(--line); border-radius:12px; background:#fafafa}
.opt input{margin-top:3px; accent-color:#2563eb}

.exp{display:none; margin-top:10px; font-size:14px; color:#111827; background:#f8fafc; border:1px dashed #cbd5e1; border-radius:12px; padding:10px}
.exp strong{color:#0f172a}

.summary{display:none; margin-top:12px}
.score{font-weight:800} .muted{color:var(--muted)}
</style>
</head>

"options": ["유지보수 비용(Maintenance Cost)", "시스템 구축비용 (Construction Cost)", "총소유비용 (Total Cost of Ownership)", "소프트웨어 라이선스비용 (Software License Cost)"], "answerIndex": 2, "explanation": "시스템 도입부터 유지·보수까지 전체 비용 계량화를 뜻합니다."}, {"id": 8, "question": "ERP에 대한 설명 중 가장 적절하지 않은 것은?", "options": ["신속한 의사결정을 지원하는 경영정보시스템이다 .", "인사, 영업, 구매, 생산, 회계 등 기업의 업무가 통합된 시스템이다 .", "모든 사용자들은 사용권한 없이도 쉽게 기업의 정보에 접근할 수 있다.", "ERP의 기본시스템에 공급망관리 , 고객지원기능 등의 확장기능을 추가할 수 있다."], "answerIndex": 2, "explanation": "ERP는 권한 관리가 철저해야 합니다."}, {"id": 9, "question": "ERP 구축 시 경험있고 유능한 컨설턴트를 활용함으로써 얻는 장점으로 적절하지 않은 것은?", "options": ["ERP기능과 관련된 필수적인 지식을 기업에 전달할 수 있다.", "숙달된 소프트웨어 구축방법론으로 실패를 최소화할 수 있다.", "기업의 업무환경에 적합한 최적의 패키지를 선정하는데 도움이 된다.", "구축프로젝트를 컨설턴트에게 일임함으로써 경영진의 참여가 없어도 쉽게 구축가능하다 ."], "answerIndex": 3, "explanation": "ERP 성공에는 경영진의 참여와 지원이 필수입니다."}, {"id": 10, "question": "클라우드 서비스 기반 ERP와 관련된 설명으로 가장 적절하지 않은 것은?", "options": ["PaaS에는 데이터베이스 클라우드 서비스와 스토리지 클라우드 서비스가 있다.", "ERP 소프트웨어 개발을 위한 플랫폼을 클라우드 서비스로 제공받는 것을 PaaS라고 한다.", "ERP 구축에 필요한 IT인프라 자원을 클라우드 서비스로 빌려 쓰는 형태를 IaaS라고 한다.", "기업의 핵심 애플리케이션인 ERP, CRM 솔루션 등의 소프트웨어를 클라우드 서비스를 통해 제공받는 것을"], "answerIndex": 0, "explanation": "DB·스토리지는 IaaS에 속합니다. PaaS는 개발 환경을 제공하는 서비스입니다."}, {"id": 11, "question": "효과적인 ERP교육을 위한 고려사항으로 가장 적절하지 않은 것은?", "options": ["다양한 교육도구를 이용하라 .", "교육에 충분한 시간을 배정하라 .", "비즈니스 프로세스가 아닌 트랜잭션에 초점을 맞춰라 .", "조직차원의 변화관리활동을 잘 이해하도록 교육을 강화하라 ."], "answerIndex": 2, "explanation": "ERP 교육은 비즈니스 프로세스 중심이어야 효과적입니다."}, {"id": 12, "question": "㈜인사는 'Best Practice' 도입을 목적으로 ERP 패키지를 도입하여 시스템을 구축하고자 한다. ㈜인사의 도 입 방법 중 가장 적절하지 않은 것은?", "options": ["BPR과 ERP 시스템 구축을 병행하는 방법", "ERP 패키지에 맞추어 BPR을 추진하는 방법", "기존 업무처리에 따라 ERP 패키지를 수정하는 방법", "BPR을 실시한 후에 이에 맞도록 ERP 시스템을 구축하는 방법"], "answerIndex": 2, "explanation": "ERP는 표준 프로세스를 받아들이고 필요시 BPR을 병행해야 합니다."}, {"id": 13, "question": "ERP의 특징에 관한 설명 중 가장 적절하지 않은 것은?", "options": ["세계적인 표준 업무절차를 반영하여 기업 조직구성원의 업무수준이 상향평준화된다 .", "ERP시스템의 안정적인 운영을 위하여 특정 H/W와 S/W업체를 중심으로 개발되고 있다.", "정확한 회계데이터 관리로 인하여 분식결산 등을 사전에 방지하는 수단으로 활용이 가능하다 .", "Parameter 설정에 의해 기업의 고유한 업무환경을 반영하게 되어 단기간에 ERP 도입이 가능하다 ."], "answerIndex": 1, "explanation": "ERP는 특정업체 종속이 아님."}, {"id": 14, "question": "ERP 선택 및 사용 시 유의점으로 가장 옳지 않은 것은?", "options": ["도입하려는 기업의 상황에 맞는 패키지를 선택해야 한다.", "데이터의 신뢰도를 높이기 위해 관리를 철저히 해야 한다.", "지속적인 교육 및 워크숍 등의 원활한 사용을 위한 노력이 필요하다 .", "현재의 기업 비즈니스 프로세스를 변경하지 않는 패키지를 선택해야 한다."], "answerIndex": 3, "explanation": "ERP는 업무 혁신을 전제로 하므로 기존 방식 고수는 부적절합니다."}, {"id": 15, "question": "ERP 구축의 성공요인으로 가장 적절하지 않은 것은?", "options": ["지속적인 ERP 교육 실시", "IT 중심의 프로젝트만 추진", "경험과 지식을 겸비한 인력으로 구성", "경영자와 전체 임직원의 높은 관심 및 참여"], "answerIndex": 1, "explanation": "ERP는 IT뿐만 아니라 전사적 참여가 필요합니다."}, {"id": 16, "question": "ERP 구축절차 중 TO-BE Process 도출, 패키지 설치, 인터페이스 문제논의를 하는 단계로 옳은 것은?", "options": ["구축단계", "구현단계", "분석단계", "설계단계"], "answerIndex": 3, "explanation": "O-BE, 설치, 인터페이스 논의는 구현단계에서 진행됩니다."}, {"id": 17, "question": "e-Business 지원 시스템을 구성하는 단위 시스템에 해당되지 않는 것은?", "options": ["성과측정관리 (BSC)", "EC(전자상거래 ) 시스템", "의사결정지원시스템 (DSS)", "고객관계관리 (CRM) 시스템"], "answerIndex": 0, "explanation": "e-Business 지원 시스템에는 BSC가 포함되지 않습니다."}, {"id": 18, "question": "[보기]에서 설명하는 전략기법은 무엇인가 ? [보기] 조직의 효율성을 제고하기 위해 업무흐름 뿐만 아니라 전체 조직을 재구축하려는 혁신전략기법 중 주 로 정보기술을 통해 기업경영의 핵심과 과정을 전면 개편함으로 경영성과를 향상시키려는 전략이다 . 신 속하고 극단적인 성격이 있으며 , 전면적인 혁신을 강조한다 .", "options": ["지식경영", "벤치마킹", "리엔지니어링", "리스트럭처링"], "answerIndex": 2, "explanation": "업무와 조직을 근본적으로 혁신하는 전략 기법입니다."}, {"id": 19, "question": "클라우드 ERP의 특징 혹은 효과에 대한 설명 중 가장 옳지 않은 것은?", "options": ["안정적이고 효율적인 데이터관리", "IT자원관리의 효율화와 관리비용의 절감", "필요한 어플리케이션을 자유롭게 설치 가능", "원격근무 환경 구현을 통한 스마트워크 환경 정착"], "answerIndex": 2, "explanation": "클라우드 ERP는 제공된 기능만 활용할 수 있습니다."}, {"id": 20, "question": "ERP의 특징에 관한 설명 중 가장 적절하지 않은 것은?", "options": ["세계적인 표준 업무절차를 반영하여 기업 조직구성원의 업무수준이 상향평준화된다 .", "ERP시스템의 안정적인 운영을 위하여 특정 H/W와 S/W업체를 중심으로 개발되고 있다.", "정확한 회계데이터 관리로 인하여 분식결산 등을 사전에 방지하는 수단으로 활용이 가능하다 .", "Parameter 설정에 의해 기업의 고유한 업무환경을 반영하게 되어 단기간에 ERP 도입이 가능하다 ."], "answerIndex": 1, "explanation": "ERP는 특정업체 종속이 아님."}, {"id": 21, "question": "[보기]는 무엇에 대한 설명인가 ? [보기] 조직의 효율성을 제고하기 위해 업무흐름 뿐만 아니라 전체 조직을 재구축하려는 경영혁신전략 기법이 다. 주로 정보기술을 통해 기업경영의 핵심과 과정을 전면 개편함으로 경영성과를 향상시키려는 경영기 법인데 매우 신속하고 극단적인 그리고 전면적인 혁신을 강조하는 이 기법은 무엇인가 ?", "options": ["지식경영", "벤치마킹", "리스트럭처링", "리엔지니어링"], "answerIndex": 3, "explanation": "업무와 조직을 근본적으로 혁신하는 전략 기법입니다."}, {"id": 22, "question": "ERP 도입의 예상 효과로 적절하지 않은 것은?", "options": ["고객 서비스 개선", "사이클 타임 증가", "최신 정보기술 도입", "통합 업무 시스템 구축"], "answerIndex": 1, "explanation": "ERP는 사이클 타임을 단축시킵니다."}, {"id": 23, "question": "기업이 클라우드 ERP를 통해 얻을 수 있는 장점으로 적절하지 않은 것은?", "options": ["기업의 데이터베이스 관리 효율성 증가", "시간과 장소에 구애받지 않고 ERP 사용이 가능", "장비관리및 서버관리에 필요한 IT 투입자원 감소", "필요한 어플리케이션을 자율적으로 설치 및 활용이 가능"], "answerIndex": 3, "explanation": "클라우드 ERP는 제한적 환경을 제공합니다."}, {"id": 24, "question": "'Best Practice' 도입을 목적으로 ERP 패키지를 도입하여 시스템을 구축하고자 할 경우 가장 옳지 않은 것은?", "options": ["BPR과 ERP 시스템 구축을 병행하는 방법", "ERP 패키지에 맞추어 BPR을 추진하는 방법", "기존 업무처리에 따라 ERP 패키지를 수정하는 방법", "BPR을 실시한 후에 이에 맞도록 ERP 시스템을 구축하는 방법"], "answerIndex": 2, "explanation": "ERP는 표준 프로세스를 기반으로 해야 합니다."}, {"id": 25, "question": "ERP 구축 전에 수행되는 단계적으로 시간의 흐름에 따라 비즈니스 프로세스를 개선해가는 점증적 방법론 은 무엇인가 ?", "options": ["ERD(Entity Relationship Diagram)", "BPI(Business Process Improvement)", "MRP(Material Requirement Program)", "SFS(Strategy Formulation & Simulation)"], "answerIndex": 1, "explanation": "BPR이 급진적이라면, BPI는 단계적·점진적 개선입니다."}, {"id": 26, "question": "BPR(Business Process Re-Engineering) 의 필요성으로 가장 적절하지 않은 것은?", "options": ["경영 환경 변화에의 대응방안 모색", "정보기술을 통한 새로운 기회의 모색", "기존 업무 방식 고수를 위한 방안 모색", "조직의 복잡성 증대와 효율성 저하에 대한 대처방안 모색"], "answerIndex": 2, "explanation": "혁신 필요성에 맞지 않습니다."}, {"id": 27, "question": "ERP 도입의 최종 목적으로 가장 적절한 것은?", "options": ["해외 매출 확대", "경영정보의 분권화", "관리자 리더십 향상", "고객만족과 이윤 극대화"], "answerIndex": 3, "explanation": "ERP 최종목표는 기업 성과 향상입니다."}, {"id": 28, "question": "ERP구축을 위한 ERP패키지 선정기준으로 가장 적절하지 않은 것은?", "options": ["시스템 보안성", "사용자 복잡성", "요구사항 부합 정도", "검증된 방법론의 적용"], "answerIndex": 1, "explanation": "선정 기준은 보안성, 요구부합, 검증된 방법론 등이지 복잡성은 고려 요인이 아닙니다."}, {"id": 29, "question": "TO-BE 프로세스 도출, 패키지 설치, 추가개발 및 수정보완 문제 논의 등이 이루어지는 ERP구축절차 단계 로 가장 적절한 것은?", "options": ["설계 단계", "구현 단계", "분석 단계", "구축 단계"], "answerIndex": 0, "explanation": "TO-BE 도출, 설치, 수정보완 논의 → 구현단계."}, {"id": 30, "question": "ERP 시스템의 프로세스 , 화면, 필드, 그리고 보고서 등 거의 모든 부분을 기업의 요구사항에 맞춰 구현하 는 방법을 무엇이라 하는가 ?", "options": ["정규화 (Normalization)", "트랜잭션 (Transaction)", "컨피규레이션 (Configuration)", "커스터마이제이션 (Customization)"], "answerIndex": 3, "explanation": "기업 요구에 맞게 ERP를 수정하는 과정입니다."}, {"id": 31, "question": "ERP를 성공적으로 도입하기 위한 전략으로 가장 적절하지 않은 것은?", "options": ["목표를 세우고 중장기적인 접근이 필요하다 .", "프로젝트 구성원은 임원 중심으로 구성해야 한다.", "현재의 업무방식만을 그대로 고수해서는 안 된다.", "최고경영층도 프로젝트에 적극적으로 참여해야 한다."], "answerIndex": 1, "explanation": "ERP 프로젝트는 현업 중심이어야 성공적입니다."}, {"id": 32, "question": "[보기]의 괄호 안에 들어갈 용어로 가장 적절한 것은? [보기] 확장된 ERP시스템 내의 ( )모듈은 공급자부터 소비자까지 이어지는 물류, 자재, 제품, 서비스 , 정 보의 흐름 전반에 걸쳐 계획하고 관리함으로써 수요와 공급의 일치를 최적으로 운영하고 관리하는 활동 이다.", "options": ["SCM(Supply Chain Management)", "ERP(Enterprise Resource Planning)", "KMS(Knowledge Management System)", "CRM(Customer Relationship Management)"], "answerIndex": 0, "explanation": "확장 ERP에서 공급망을 관리하는 모듈입니다."}, {"id": 33, "question": "ERP 구축 시 컨설턴트를 고용함으로써 얻는 장점으로 가장 적절하지 않은 것은?", "options": ["프로젝트 주도권을 컨설턴트로 넘길 수 있다.", "ERP기능과 관련된 필수적인 지식을 기업에 전달할 수 있다.", "숙달된 소프트웨어 구축방법론으로 실패를 최소화할 수 있다.", "컨설턴트는 편견이 없고 목적 지향적이기 때문에 최적의 패키지를 선정하는데 도움이 된다."], "answerIndex": 0, "explanation": "컨설턴트는 지원 역할이지 주도자가 아닙니다."}, {"id": 34, "question": "클라우드 컴퓨팅 (Cloud Computing) 의 장점으로 적절하지 않은 것은?", "options": ["사용자의 IT투자비용이 줄어든다 .", "필요에 따라 언제든지 컴퓨팅 자원을 사용할 수 있다.", "장비관리 업무와 PC 및 서버 등의 보유자원을 줄일 수 있다.", "사용자가 원하는 애플리케이션을 자유롭게 설치하여 사용할 수 있다."], "answerIndex": 3, "explanation": "클라우드 ERP는 제공된 범위 내에서만 사용합니다."}, {"id": 35, "question": "ERP의 특징으로 가장 적절하지 않은 것은?", "options": ["실시간 정보처리 체계 구축", "다국적 , 다통화 , 다언어 지원", "파라미터 지정에 의한 프로세스의 정의", "기능별로 상호 분리된 독립시스템 구축"], "answerIndex": 3, "explanation": "ERP는 기능별 독립이 아니라 통합이 핵심입니다."}, {"id": 36, "question": "ERP패키지의 효과적인 도입을 위한 고려사항으로 적절하지 않은 것은?", "options": ["경영진의 확고한 의지가 있어야 한다.", "경험 있는 유능한 컨설턴트를 활용해야 한다.", "전사적으로 전 임직원의 참여를 유도해야 한다.", "현업을 반영하도록 최대한의 커스터마이징을 실행한다 ."], "answerIndex": 3, "explanation": "커스터마이징은 최소화해야 효과적입니다."}, {"id": 37, "question": "ERP와 기존의 정보시스템 (MIS) 특성 간의 차이점에 대한 설명으로 가장 적절하지 않은 것은?", "options": ["기존 정보시스템의 업무범위는 단위업무이고 , ERP는 통합업무를 담당한다 .", "기존 정보시스템의 전산화 형태는 중앙집중식이고 , ERP는 분산처리구조이다 .", "기존 정보시스템은 수평적으로 업무를 처리하고 , ERP는 수직적으로 업무를 처리한다 .", "기존 정보시스템은 파일시스템을 이용하고 , ERP는 관계형 데이터베이스시스템 (RDBMS) 을 이용한다 ."], "answerIndex": 2, "explanation": "ERP도 수평적 프로세스 통합입니다."}, {"id": 38, "question": "ERP에 대한 설명 중 가장 적절하지 않은 것은?", "options": ["신속한 의사결정을 지원하는 경영정보시스템이다 .", "기능 최적화에서 전체 최적화를 목표로 한 시스템이다 .", "인사, 영업, 구매, 생산, 회계 등 기업의 업무가 통합된 시스템이다 .", "모든 사용자들은 사용권한 없이 쉽게 기업의 정보에 접근할 수 있다."], "answerIndex": 3, "explanation": "ERP는 권한관리가 철저해야 합니다."}, {"id": 39, "question": "ERP 아웃소싱 (Outsourcing) 에 대한 설명으로 적절하지 않은 것은?", "options": ["ERP 자체개발에서 발생할 수 있는 기술력 부족을 해결할 수 있다.", "ERP 아웃소싱을 통해 기업이 가지고 있지 못한 지식을 획득할 수 있다.", "ERP 개발과 구축, 운영, 유지보수에 필요한 인적 자원을 절약할 수 있다.", "ERP 시스템 구축 후에는 IT아웃소싱 업체로부터 독립적으로 운영할 수 있다."], "answerIndex": 3, "explanation": "아웃소싱은 일정 부분 지속적 의존이 존재합니다."}, {"id": 40, "question": "ERP의 기능적 특징으로 가장 적절하지 않은 것은?", "options": ["경영정보제공 및 경영조기경보체계를 구축", "선진 비즈니스 프로세스 모델에 의한 BPR 지원", "중복업무의 배제 및 실시간 정보처리 체계 구축", "특정 하드웨어나 특정 운영체체와 연계 가능하므로 보안성 강화"], "answerIndex": 3, "explanation": "ERP는 특정 시스템 종속이 아니라 범용 지원을 지향합니다."}, {"id": 41, "question": "차세대 ERP의 비즈니스 애널리틱스 (Business Analytics) 에 관한 설명으로 가장 적절하지 않은 것은?", "options": ["비즈니스 애널리틱스는 구조화된 데이터 (structured data)만 분석대상으로 한다.", "ERP시스템의 방대한 데이터 분석을 위해 비즈니스 애널리틱스가 차세대 ERP의 핵심요소가 되고 있다.", "비즈니스 애널리틱스는 리포트 , 쿼리, 대시보드 , 스코어카드뿐만 아니라 예측모델링과 같은 진보된 형태의 분석기능도 제공한다 .", "비즈니스 애널리틱스는 질의 및 보고와 같은 기본적 분석기술과 예측 모델링과 같은 수학적으로 정교한 수"], "answerIndex": 0, "explanation": "비즈니스 애널리틱스는 비정형 데이터까지 분석합니다."}, {"id": 42, "question": "ERP시스템의 SCM 모듈을 실행함으로써 얻는 장점으로 가장 적절하지 않은 것은?", "options": ["공급사슬에서의 가시성 확보로 공급 및 수요변화에 대한 신속한 대응이 가능하다 .", "정보투명성을 통해 재고수준 감소 및 재고회전율 (inventory turnover) 증가를 달성할 수 있다.", "공급사슬에서의 계획(plan), 조달(source), 제조(make) 및 배송(deliver) 활동 등 통합 프로세스를 지원한다 .", "마케팅 (marketing), 판매(sales) 및 고객서비스 (customer service) 를 자동화함으로써 현재 및 미래 고객들과"], "answerIndex": 3, "explanation": "이는 CRM 기능입니다. SCM은 공급망 최적화가 핵심입니다."}, {"id": 43, "question": "클라우드 컴퓨팅의 유형 중에서 PaaS(Platform as a Service) 에 대한 설명으로 적절하지 않은 것은?", "options": ["사용자는 인프라의 기본 투자 없이 응용 소프트웨어의 테스트가 가능하다 .", "사용자는 응용 소프트웨어 개발 환경을 설치하는데 소요되는 비용을 절약할 수 있다.", "사용자는 응용 소프트웨어 개발에 필요한 다양한 플랫폼 환경을 직접 구축할 수 있다.", "사용자는 하드웨어 및 소프트웨어의 인프라의 유지 보수 및 관리 비용을 절약할 수 있다."], "answerIndex": 2, "explanation": "PaaS는 개발환경을 제공하는 서비스이므로 사용자가 직접 플랫폼을 구축하지 않습니다."}, {"id": 44, "question": "클라우드 서비스 사업자가 클라우드 컴퓨팅 서버에 ERP소프트웨어를 제공하고 , 사용자가 원격으로 접속해 ERP소프트웨어를 활용하는 서비스를 무엇이라 하는가 ?", "options": ["DaaS(Desktop as a Service)", "PaaS(Platform as a Service)", "SaaS(Software as a Service)", "IaaS(Infrastructure as a Service)"], "answerIndex": 2, "explanation": "클라우드 서버에서 소프트웨어를 서비스로 제공."}, {"id": 45, "question": "ERP 도입 시 선정기준으로 가장 적절하지 않은 것은?", "options": ["경영진의 확고한 의지가 있어야 한다.", "경험 있는 유능한 컨설턴트를 활용해야 한다.", "전사적으로 전 임직원의 참여를 유도해야 한다.", "다른 기업에서 가장 많이 사용하는 패키지를 선택하는 것이 좋다."], "answerIndex": 3, "explanation": "기업 상황에 맞는 패키지 선택해야 함."}, {"id": 46, "question": "ERP의 선택기준으로 가장 적절하지 않은 것은?", "options": ["커스터마이징의 최대화", "자사에 맞는 패키지 선정", "현업 중심의 프로젝트 진행", "TFT는 최고의 엘리트 사원으로 구성"], "answerIndex": 0, "explanation": "ERP는 표준 프로세스 기반."}, {"id": 47, "question": "ERP에 대한 설명으로 가장 적절하지 않은 것은?", "options": ["경영혁신환경을 뒷받침하는 새로운 경영업무 시스템 중 하나이다 .", "기업의 전반적인 업무과정이 컴퓨터로 연결되어 실시간 관리를 가능하게 한다.", "기업 내 각 영역의 업무프로세스를 지원하고 단위별 업무처리의 강화를 추구하는 시스템이다 .", "전통적 정보시스템과 비교하여 보다 완벽한 형태의 통합적인 정보인프라구축을 가능하게 해주는 신 경영혁"], "answerIndex": 2, "explanation": "ERP는 통합 지향, 단위업무 강화 아님."}, {"id": 48, "question": "ERP와 인공지능 (AI), 빅데이터 (Big Data), 사물인터넷 (IoT) 등 혁신기술과의 관계에 대한 설명으로 가장 적 절하지 않은 것은?", "options": ["현재 ERP는 기업 내 각 영역의 업무프로세스를 지원하여 독립적으로 단위별 업무처리를 추구하는 시스템 으로 발전하고 있다.", "제조업에서는 빅데이터 분석기술을 기반으로 생산자동화를 구현하고 ERP와 연계하여 생산계획의 선제적 예측과 실시간 의사결정이 가능하다 .", "ERP에서 생성되고 축적된 빅데이터를 활용하여 기업의 새로운 업무개척이 가능해지고 , 비즈니스 간 융합을 지원하는 시스템으로 확대가 가능하다 .", "현재 ERP는 인공지능 및 빅데이터 분석기술과의 융합으로 전략경영 등의 분석도구를 추가하여 상위계층의"], "answerIndex": 0, "explanation": "잘못된 설명"}, {"id": 49, "question": "ERP와 전통적인 정보시스템 (MIS) 특성 간의 차이점에 대한 설명으로 가장 적절하지 않은 것은?", "options": ["전통적인 정보시스템의 시스템구조는 폐쇄형이나 ERP는 개방성을 갖는다 .", "전통적인 정보시스템의 업무범위는 단위업무이고 , ERP는 통합업무를 처리한다 .", "전통적인 정보시스템의 업무처리 대상은 Process 중심이나 ERP는 Task 중심이다 .", "전통적인 정보시스템의 저장구조는 파일시스템을 이용하나 ERP는 관계형 데이터베이스시스템 (RDBMS) 등"], "answerIndex": 2, "explanation": "ERP는 프로세스 중심."}, {"id": 50, "question": "기업에서 ERP시스템을 도입하기 위해 분석, 설계, 구축, 구현 등의 단계를 거친다 . 이 과정에서 필수적으로 거쳐야하는 \"GAP분석\" 활동의 의미를 적절하게 설명한 것은?", "options": ["TO－BE 프로세스 분석", "TO－BE 프로세스에 맞게 모듈을 조합", "현재업무 (AS－IS) 및 시스템 문제 분석", "패키지 기능과 TO－BE 프로세스와의 차이 분석"], "answerIndex": 3, "explanation": "GAP분석 정의."}, {"id": 51, "question": "ERP의 특징에 대한 설명으로 가장 옳지 않은 것은?", "options": ["Open Multi-vendor: 특정 H/W 업체에만 의존하는 open 형태를 채용, C/S형의 시스템 구축이 가능하다 .", "통합업무시스템 : 세계유수기업이 채용하고 있는 Best Practice Business Process 를 공통화 , 표준화 시킨다 .", "Parameter 설정에 의한 단기간의 도입과 개발이 가능: Parameter 설정에 의해 각 기업과 부문의 특수성을 고려할 수 있다.", "다국적 , 다통화 , 다언어 : 각 나라의 법률과 대표적인 상거래 습관, 생산방식이 시스템에 입력되어 있어서 사"], "answerIndex": 0, "explanation": "ERP는 Open 구조."}, {"id": 52, "question": "[보기]에서 가장 성공적인 ERP 도입이 기대되는 회사는 무엇인가 ? [보기] § 회사 A: 현재 업무 방식이 최대한 반영될 수 있도록 업무 단위에 맞추어 ERP 도입을 추진 중이다 . § 회사 B: 시스템의 전문지식이 풍부한 IT 및 전산 관련 부서 구성원으로 도입 TFT를 결성하였다 . § 회사 C: 프로세스 개선을 위해 효율적인 업무 프로세스를 재정립하고 , 성공적인 ERP 도입을 위해 유능 한 컨설턴트를 고용하고자 한다. § 회사 D: ERP 도입 과정에서 부서 간 갈등 발생 시, 최고경영층의 개입이 최소화 될 수 있도록 하향식 (Top-Down) 의사결정을 배제한다 .", "options": ["회사 A", "회사 B", "회사 C", "회사 D"], "answerIndex": 2, "explanation": "프로세스 개선 + 컨설턴트 활용 → 가장 성공적."}, {"id": 53, "question": "머신러닝 워크플로우 프로세스의 순서를 고르시오 .", "options": ["데이터 수집 → 점검 및 탐색 → 전처리 및 정제 → 모델링 및 훈련 → 평가 → 배포", "점검 및 탐색 → 데이터 수집 → 전처리 및 정제 → 모델링 및 훈련 → 평가 → 배포", "데이터 수집 → 전처리 및 정제 → 모델링 및 훈련 → 평가 → 배포 → 점검 및 탐색", "데이터  초기 단계는 규칙 기반 자동화만 가능하며, 인지·학습 능력은 없음. 학습과 창의적 의사결정은 AI와 결합된 고도화 단계에서 가능합니다."}, {"id": 66, "question": "[보기]를 참고하여 ㈜스마트생산성의 성공적인 ERP 도입을 위한 전략으로 옳지 않은 것은? [보기] ㈜스마트생산성은 기존의 수작업 중심 업무 프로세스를 개선하기 위해 ERP 시스템을 도입하려 한다. 이를 통해 업무 효율성을 높이고 , 데이터 일관성을 확보하는 것이 목표이다 . 하지만 ERP 도입 과정에서 일부 임직원들은 기존 업무 방식을 그대로 유지하려 하거나 , 시스템 기능만을 중점적으로 고려하는 경향 이 있었다 .", "options": ["BPR에 대비해야 한다.", "업무상의 효과를 고려하여 도입 대상을 선정해야 한다.", "최고경영진이 함께 참여하는 프로젝트로 진행해야 한다.", "임직원들의 의지를 존중하여 , 기존의 업무 방식을 그대로 유지해야 한다."], "answerIndex": 3, "explanation": "ERP는 기존 방식 고수가 아닌, BPR(업무 재설계)과 혁신을 전제로 도입해야 합니다."}];

const $ = (s,el=document)=>el.querySelector(s);
const $$ = (s,el=document)=>Array.from(el.querySelectorAll(s));
const byId = id=>document.getElementById(id);
const shuffle = arr => { for(let i=arr.length-1;i>0;i--){ const j=Math.floor(Math.random()*(i+1)); [arr[i],arr[j]]=[arr[j],arr[i]]; } return arr };

function normalizeItems(arr){
  return (arr||[]).map((q,idx)=>({ 
    id: q.id ?? (idx+1),
    question: String(q.question ?? ''),
    options: [0,1,2,3].map(i=> String((q.options||[])[i] ?? '')),
    answerIndex: (q.answerIndex==null? null : Number(q.answerIndex)),
    explanation: String(q.explanation ?? '')
  }));
}

let items = normalizeItems(QUESTIONS);
let submitted = false;

function labelFor(i){ return (i+1).toString() } // 1,2,3,4

function render(){
  const box = byId('quiz'); box.innerHTML='';
  items.forEach((q,idx)=>{
    const card = document.createElement('div'); card.className='qcard'; card.dataset.qid = q.id;
    card.innerHTML = `
      <div class="qhead">
        <div class="qnum">Q${idx+1}</div>
        <div class="flag" data-flag></div>
      </div>
      <div class="qtext">${q.question}</div>
      <div class="opts"></div>
      <div class="exp"><strong>풀이</strong><div class="exptext">${q.explanation||''}</div></div>`;
    const opts = $('.opts', card);
    (q.options||[]).forEach((txt,i)=>{
      const opt = document.createElement('label'); opt.className='opt';
      const id = `q${q.id}_o${i}`;
      opt.innerHTML = `
        <input type="radio" name="q${q.id}" id="${id}" value="${i}">
        <div><strong>${labelFor(i)}.</strong> <span>${txt||''}</span></div>`;
      opts.appendChild(opt);
    });
    opts.addEventListener('change',(e)=>{ if(e.target && e.target.name===`q${q.id}`){ q.choice = parseInt(e.target.value,10); updateLeftCount(); } });
    box.appendChild(card);
  });
  updateLeftCount();
  byId('totalSpan').textContent = ` / ${items.length}`;
}

function updateLeftCount(){
  const left = items.filter(q=> q.choice===undefined).length;
  byId('left').textContent = `${left}`;
}

function submitAll(){
  const left = items.filter(q=> q.choice===undefined).length;
  if(left>0){ if(!confirm(`아직 ${left}문항이 남아있습니다. 그대로 제출할까요?`)) return; }
  submitted = true;

  let correct=0; const total=items.length;
  items.forEach(q=>{
    const card = $(`.qcard[data-qid="${q.id}"]`);
    const exp = $('.exp', card);
    const radios = $$(`input[name="q${q.id}"]`, card);
    const flag = card.querySelector('[data-flag]');
    const isCorrect = (q.answerIndex!=null) && (q.choice===q.answerIndex);

    if(isCorrect){ correct++; flag.textContent='O'; flag.className='flag ok' }
    else { flag.textContent='X'; flag.className='flag bad' }

    radios.forEach((r,i)=>{ r.parentElement.style.borderColor = (i===q.answerIndex?'#86efac':'#e5e7eb'); r.disabled = true; });

    const expText = $('.exptext', card);
    const correctLabel = labelFor(q.answerIndex ?? 0);
    const correctText = (q.options||[])[q.answerIndex ?? 0] || '';
    const extra = isCorrect? '' : `<div style="margin-top:6px">정답: <strong>${correctLabel}</strong> — ${correctText}</div>`;
    expText.innerHTML = (q.explanation||'') + extra;
    exp.style.display = 'block';
  });

  const rate = total? Math.round((correct/total)*100) : 0;
  const sum = byId('summary');
  sum.innerHTML = `<div><strong class="score">정답: ${correct} / ${total} (${rate}%)</strong></div>`+
    `<div class="muted" style="margin-top:6px">각 문항에 O/X와 해설이 표시되었습니다.</div>`;
  sum.style.display = 'block';
  byId('btnSubmit').disabled = true;
}

function retryShuffled(){
  items = normalizeItems(QUESTIONS);
  shuffle(items);
  items.forEach(q=> delete q.choice);
  byId('summary').style.display='none';
  byId('btnSubmit').disabled = false;
  render();
}

byId('btnSubmit').addEventListener('click', submitAll);
byId('btnRetry').addEventListener('click', retryShuffled);
byId('btnShuffle').addEventListener('click', ()=>{ shuffle(items); render(); });

render();
</script>
</body>
</html>
